#creates the client object to access discord methods
client = discord.Client()
usermessage = '' #defines and intializes the variable that will be used to read the user's messages



@client.event
async def on_ready():
    
    #gets the channel that the discord moderators will use to interact with the bots
    general_channel = client.get_channel(123)



@client.event
async def on_message(message):

    
    total = 0



    general_channel = client.get_channel(123) # gets the ID of the channel the bot listens in on
    if message.author.bot: return # blocks the bot from counting its input as a command'

    if message.content.startswith("??id"): # if any user's message starts with '??id' then the bot will know that the user is trying to access it
        usermessage = message.content # gets the entire message of the user
        usermessage = usermessage[4:] #skips over the first 4 letters that would tell the bot that the user is talking to it, to get the actual id that will be used
        useriddd = int(usermessage) #defines and intializes the userid that will be used 



        if useriddd not in shirtids: #if the id given is not present within the list of ids, add it to the list of ids
            shirtids.append(useriddd)
            await general_channel.send("ID added! Thank you!")
        else: 
            await general_channel.send("ID has already been added.")







    if message.content.startswith("!!"): # if any user's message starts with '!!'

        embed = Embed( #defines the color of the embed and adds a timestamp
            color=0xFFCCE5,
            timestamp='now'
            )

        usermessage = message.content # gets the entire message of the user
        usermessage = usermessage[2:] #skips over the first 2 characters to get the actual username


        response = requests.get("https://api.roblox.com/users/get-by-username?username=%s" % usermessage) #gets the user's ID from their username
        a = response.json()
        response.close()
        inventory = requests.get("https://inventory.roblox.com/v2/users/%s/inventory?assetTypes=1&limit=10&sortOrder=Asc" % a['Id']) #checks if the user's inventory is open


        if inventory.status_code == 403: #if the response to the request is 403 then their inventory is inaccessable
            embed.set_footer(text='Inventory is closed')
            inventory.close()
            await general_channel.send(embed=embed)
        else:
            embed.add_field(name='Username', value= '[@%s](https://www.roblox.com/users/%s/profile)' % (usermessage, a['Id'])) #if their inventory is not closed then search their inventory

            role = requests.get('https://groups.roblox.com/v2/users/%s/groups/roles' % a['Id']) #gets all the ids of the roles within the groups that they're in
            search = role.json()
            testt = json.dumps(search)
            role.close()

            rolles = ["32046656", "32046667", "32052315", "32046784", "32053305", "32045373", "37164376", "32053303", "37880070"] #ids of roles that the bot looks for // ids from the actual group

            image1 = ('https://web.roblox.com/Thumbs/Avatar.ashx?x=200&y=200&Format=Png&userid=%s' % a['Id']) #gets the image of the user's avatar

            totalshirt = ""

            requesst = 0 #defines and intalizes the variable that will be used to check if the requests get api limited

            for x in range(1,(15)):
                shirt1 = requests.get("https://inventory.roblox.com/v1/users/%s/inventory/Pants?pageNumber=%s&itemsPerPage=100000" % (a['Id'], x)) #sends requests to get the first 15 pages of the user's pants inventory

                shirt2 = shirt1.json()
                shirt3 = json.dumps(shirt2)
                q1 = shirt3.find("[")
                q2 = shirt3.find("]") + 1
                shirt4 = shirt3[q1:q2]
                if shirt4 == '[]': #if the list is empty then the api requests got limited
                    break 
                elif shirt4 == '[{"code": 0, "message": "TooManyRequests"}]': #if the list contains this then the api requests got limited
                    requesst+=1
                    print("too many request")
                    general_channel.send('Come back in 5 mins, total might be inaccurate') #the bot sends a message back to the channel that they should come back later because it didn't get to all of the pants and shirts
                    break
                else:
                    totalshirt += shirt4

